            content : 'Just trying to create thread',
            upVote : 0,
            downVote : 0,
            id : 0
        },
        {
            title : 'Thread name #2',
            content : 'What a bird',
            upVote : 0,
            downVote : 0,
            id :1
        },
        {
            title : 'Thread name #2',
            content : 'dafuq',
            upVote : 0,
            downVote : 0,
            id :2
        }   
    ]);

    return(
        <div>
            {threads.map(thread =>(
                //<thread title={threads.title} content={threads.content} upVote={threads.upVote} downVote={threads.downVote} key={threads.id} />
